const { NavLink } = require("react-router-dom")

const Navbar = (props) => {
    // if local storage user exists render profile : signup
    return (
        <ul className="navbar">
            {props.userId ?
                <ul className="navbar">
                                            <NavLink className="navbar_link" to="/logout">LOGOUT</NavLink>
                        <NavLink className="navbar_link" to="/home">HOME</NavLink>
                        </ul>
                        :
<ul className="navbar">                        <NavLink className="navbar_link" id="signup_link" to="/signup">SIGNUP</NavLink>
                        <NavLink className="navbar_link" to="/login">LOGIN</NavLink>
                        </ul>
            }


        </ul>

    )
}

export default Navbar
